  let pl = fen.players[uplayer];
  let top = isEmpty(fen.commissioned) ? null : arrLast(fen.commissioned);
  let rankstr = 'A23456789TJQK';
  let points = !top || get_rank_index(rank, rankstr) >= get_rank_index(top.rank, rankstr) ? 1 : 0;
