  let sameturn = sameuser && samegame && isList(Prevturn) && isList(Turn) && sameList(Prevturn, Turn);
  G = g;
  U = firstCond(Serverdata.users, x => x.name == uname);
  let wasmyturn = isList(Prevturn) && Prevturn.includes(U.name);
