function simpleRep(val) {
  if (nundef(val) || val === '') {
    return '_';
  } else if (isSimple(val)) return val;
  else if (isList(val)) {
    return '[' + val.map(x => simpleRep(x)).join(', ') + ']';
  } else if (typeof val == 'object') {
    let s = [];
    for (const k in val) {
      if (isEmpty(val[k])) continue;
      let s1 = simpleRep(val[k]);
      if (k == '_set') s1 = '{' + s1.substring(1, s1.length - 1) + '}';
      s.push(s1);
    }
    return s.join(', ');
  }
}
