function tri1() {
  let sq3 = Math.sqrt(3);
  let a = 48;
  let wp = a / 4, hp = a / 4, h = sq3 * a / 2;
  let [xoff, dx, yoff, dy] = [h + wp / 2, 2 * h, hp / 2, a / 2];
  let [rows, maxcols] = [3, 4];
  let ys = 2 + 3 * rows;
  let xs = maxcols;
  let x = xoff, y = yoff;
  let pts = [];
  let infos = [];
  let idx = 0;
  let yEven = true;
  for (let i = 0; i < ys; i++) {
    let tcolOffset = yEven ? 1 : 0;
    let isCenterRow = i >= 2 && ((i - 2) % 3) == 0;
    for (let j = 0; j < xs + (1 - tcolOffset); j++) {
      let pt = { x: x, y: y };
      pts.push(pt);
      infos.push({ index: idx, tcol: tcolOffset + 2 * j, trow: i, x: x, y: y, pt: pt, isCenterRow: isCenterRow, isHexCenter: isCenterRow, isCenterCol: j % 2 == 1 });
      x += dx;
      idx += 1;
    }
    yEven = !yEven;
    y += dy; x = i % 2 ? xoff : wp / 2;
  }
  let byrc = {};
  for (const i of infos) {
    lookupSet(byrc, [i.trow, i.tcol], i.index);
  }
  console.log('byrc', byrc)
  let byxy = {};
  let adjList = [];
  let di = {};
  for (const info of infos) {
    let [r, c] = [info.trow, info.tcol];
    info.nodes = [
      lookup(byrc, [r - 2, c]),
      lookup(byrc, [r - 1, c + 1]),
      lookup(byrc, [r + 1, c + 1]),
      lookup(byrc, [r + 2, c]),
      lookup(byrc, [r + 1, c - 1]),
      lookup(byrc, [r + 1, c - 1]),
    ];
    for (let i = 0; i < 6; i++) {
      let n1 = info.nodes[i];
      if (n1 == null) continue;
      let n2 = info.nodes[(i + 1 % 6)];
      if (n2 == null) continue;
      if (lookup(di, [n1, n2]) || lookup(di, [n2, n1])) continue;
      lookupSet(di, [n1, n2], true);
      adjList.push([n1, n2]);
    }
    info.neighbors = [
      lookup(byrc, [r - 3, c + 1]),
      lookup(byrc, [r, c + 2]),
      lookup(byrc, [r + 3, c + 1]),
      lookup(byrc, [r + 3, c - 1]),
      lookup(byrc, [r, c - 2]),
      lookup(byrc, [r - 3, c - 1]),
    ];
  }
  let sym = chooseRandom(getAnimals());
  let items = [];
  for (const info of infos) {
    let item = info.isHexCenter ? drawBee(info.pt) : drawSym(sym, info.pt);
    items.push(item);
  }
}
